import React, { Component } from "react";
import Title from "./Title";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1> selected works </h1>
        <div className="page">
          <Title text="branding" />
          <Title text="apple" />
        </div>
      </div>
    );
  }
}

export default App;
